import './App.css';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Radio from './components/radio';
function App() {
  return (
    <BrowserRouter>
    <Routes>
      <Route path='/' element={<Landing_Page/>}/>
      <Route path='Yearly-App-Traffic' element={<Roi_1/>}/>
      <Route path='Estimate-App-Trafic' element={<Roi_2/>}/>
      <Route path='Web-Checkout' element={<Roi_3/>}/>
      <Route path='Native-Conversion-Lift' element={<Roi_4/>}/>
      <Route path='Average-Order-Value' element={<Roi_5/>}/>
      <Route path='Email-Capture' element={<Email_Capture/>}/>
      <Route path='Email-send' element={<Emailsend/>}/>
      <Route path='Access' element={<Access/>}/>
      <Route path='Email' element={<BILDITROIEmail/>}/>
    </Routes>
  </BrowserRouter>
  );
}

export default App;
